css:
@-moz-document domain("www.tensorflow.org") {
:root {
    --img: hsl(0, 0%, 100%);
    --back1: hsl(0, 0%, 7%);
    --back2: hsl(0, 0%, 15%);
    --back3: hsl(0, 0%, 20%);
    --text1: hsl(0, 0%, 90%);
    --link: hsl(33, 100%, 50%);
}
.devsite-header-background, .devsite-top-logo-row-wrapper, .devsite-searchbox, .devsite-site-logo, .devsite-doc-set-nav-tab-list, .devsite-overflow-tabs-scroll-button, pre, code, blockquote, td {
    background-color: var(--back2) !important;
    color: var(--text1) !important;
}
.devsite-wrapper, nav, aside, footer {
    background-color: var(--back1) !important;
    color: var(--text1) !important;
}
h1, a, .devsite-footer-linkbox, .devsite-nav-active {
    color: var(--link)!important;
}
.devsite-nav-title-no-path, th {
    background-color: var(--back3) !important;
    color: var(--text1) !important;
}
span.kd-button, div.label, .devsite-section-nav {
    background-color: var(--back3) !important;
    color: var(--link) !important;
}
img {
    background-color: var(--white) !important;
}
}
